import React from "react";

export default function Header() {
  const style = {
    display: "flex",
    justifyContent: "space evenly",
  };
  const style2 = {
    display: "flex",
    justifyContent: "start",
  };

  return (
    <header style={style}>
      <div style={style2}>WE CART</div>
      <a href="">
        <button>Sell It</button>
      </a>
    </header>
  );
}
